import React from "react";
import MedicineCard from "./MedicineCard";

const MedicineList = () => {
  return (
    <div>
      <MedicineCard
        stock={10}
        name="Aferin"
        description="Ağrı Kesici"
        photoUrl="https://imgs3.star.com.tr/imgsdisk/maintmps/2020/09/18/aferin-ilaci-ne-ise-yarar-799_2-41.jpg"
      />
    </div>
  );
};

export default MedicineList;
